import React, { useContext } from "react"; // Assurez-vous que useContext est importé
import Shilde2 from "./Shilde2";
import { AppContext } from "./P17"; // Assurez-vous que le chemin est correct

export default function Shilde1() {
  const darckmode = useContext(AppContext); // Utilisation du contexte

  return (
    <div
      style={
        darckmode
          ? { color: "white", backgroundColor: "black" }
          : {}
      }
    >
      <table
        className="table"
        height="1000px"
        style={
          darckmode
            ? { color: "white", backgroundColor: "black" }
            : {}
        }
      >
        <tr>
          <td>
            <h1
              style={
                darckmode
                  ? { color: "white", backgroundColor: "black" }
                  : {}
              }
            >
              hello world
            </h1>
          </td>
          <td>
            <p
              style={
                darckmode
                  ? { color: "white", backgroundColor: "black" }
                  : {}
              }
            >
              bonjour les enfants
            </p>
          </td>
          <td>
            <Shilde2 darckmode={darckmode} />
          </td>
        </tr>
        {/* Répétez les lignes si nécessaire */}
      </table>
    </div>
  );
}
